[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pubtator"}}, {"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "diabetes", "limit": 10}}, {"name": "mcp__pubdictionaries__find_ids", "input": {"labels": "Diabetes Mellitus", "dictionary": "MeSH"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubtator", "sparql_query": "PREFIX oa: <http://www.w3.org/ns/oa#>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT DISTINCT ?diseaseId
FROM <http://rdfportal.org/dataset/pubtator_central>
WHERE {
  ?ann a oa:Annotation ;
       dcterms:subject "Disease" ;
       oa:hasBody ?diseaseId .
  FILTER(CONTAINS(STR(?diseaseId), "diabetes") || CONTAINS(STR(?diseaseId), "D003920"))
}
LIMIT 10"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(DISTINCT ?strain) as ?count)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain .
  ?ot a schema:OxygenTolerance ;
      schema:describesStrain ?strain ;
      schema:hasOxygenTolerance ?oxygenTolerance .
  FILTER(CONTAINS(LCASE(?oxygenTolerance), "anaerobic"))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT DISTINCT ?oxygenTolerance (COUNT(?strain) as ?count)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain .
  ?ot a schema:OxygenTolerance ;
      schema:describesStrain ?strain ;
      schema:hasOxygenTolerance ?oxygenTolerance .
}
GROUP BY ?oxygenTolerance
ORDER BY DESC(?count)
LIMIT 20"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(DISTINCT ?strain) as ?total_anaerobic_strains)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain .
  ?ot a schema:OxygenTolerance ;
      schema:describesStrain ?strain ;
      schema:hasOxygenTolerance ?oxygenTolerance .
  FILTER(?oxygenTolerance IN ("anaerobe", "obligate anaerobe", "facultative anaerobe"))
}"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "ddbj"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT ?locus_tag ?gene_symbol ?product ?protein_id
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?gene a nuc:Gene ;
        nuc:locus_tag "Mal52_08030" .
  OPTIONAL { ?gene nuc:gene ?gene_symbol }
  OPTIONAL {
    ?cds sio:SIO_010081 ?gene ;
         nuc:locus_tag "Mal52_08030" ;
         nuc:product ?product ;
         rdfs:seeAlso ?protein_id .
    FILTER(CONTAINS(STR(?protein_id), "ncbiprotein"))
  }
  FILTER(CONTAINS(STR(?gene), "CP036276.1"))
}"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>
PREFIX dct: <http://purl.org/dc/terms/>

SELECT ?category ?identifier ?en_label ?ja_label
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?category a owl:Class ;
            rdfs:subClassOf nando:1000001 ;
            dct:identifier ?identifier ;
            rdfs:label ?en_label ;
            rdfs:label ?ja_label .
  FILTER(LANG(?en_label) = "en")
  FILTER(LANG(?ja_label) = "ja" && !REGEX(STR(?ja_label), "^[\u3041-\u3093]+$"))
}
ORDER BY ?identifier"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT ?category ?label
WHERE {
  GRAPH <http://nanbyodata.jp/ontology/nando> {
    ?category a owl:Class ;
              rdfs:subClassOf nando:1000001 ;
              rdfs:label ?label .
    FILTER(LANG(?label) = "en")
  }
}
ORDER BY ?label"}}, {"name": "mcp__ols__searchClasses", "input": {"ontologyId": "nando", "query": "NANDO:1000001"}}, {"name": "mcp__ols__searchClasses", "input": {"ontologyId": "nando", "query": "disease category", "pageSize": 50}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?category ?label
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?category a owl:Class ;
            rdfs:subClassOf <http://nanbyodata.jp/ontology/NANDO_1000001> ;
            rdfs:label ?label .
  FILTER(LANG(?label) = "en")
}
ORDER BY ?label
LIMIT 50"}}]
